import React from "react";
import IconItem from "./IconItem";
import "./SideBar.css";
import {
    VscMenu, VscFiles, VscSearch, VscSourceControl, VscCalendar, VscAccount, VscSettingsGear, VscTerminal
} from "react-icons/vsc";

function SideBar() {
    return (
        <div className="left-bar">
            {/* TOP ICONS */}
            <div className="left-bar-top">
                <IconItem icon={VscMenu} height="35px" fontSize="1.0rem"/>
                <IconItem icon={VscFiles}/>
                <IconItem icon={VscSearch}/>
                <IconItem icon={VscSourceControl}/>
                <IconItem icon={VscCalendar}/>
            </div>
            {/* BOTTOM ICONS */}
            <div className="left-bar-bottom">
                <IconItem icon={VscTerminal}/>
                <IconItem icon={VscAccount}/>
                <IconItem icon={VscSettingsGear}/>
            </div>
        </div>
    );
}

export default SideBar;
